SET IDENTITY_INSERT [dbo].[client_query] OFF


GO
update clients 
set VIP=t.newlevel from 
(
select *, case 
when VIP_level is null or VIP_level='' then 0 else substring(VIP_level, 4, 1) end as newlevel from  [dbo].[client_query] where IsVIP=1 
) as t
where clients.ID=t.EnterpriseID

IF NOT EXISTS (SELECT * FROM sys.objects WHERE object_id =
OBJECT_ID(N'[dbo].[client_query]') AND type in (N'U'))
BEGIN
drop table [dbo].[client_query];
END;


